import React from 'react';
import Person from './Person';

const App: React.FC = () => {
  const person: Person = {
    name: 'sanch',
    age: 30,
    sayHello: () => {
      console.log(`Hello, my name is ${person.name}`);
    }
  };

  const handleClick = () => {
    person.sayHello();
  };

  return (
    <div>
      <p>Name: {person.name}</p>
      <p>Age: {person.age}</p>
      <button onClick={handleClick}>Say Hello</button>
    </div>
  );
};

export default App;
